import React from "react";
import { useLocation } from "react-router-dom";

const UserProfile = () => {
  const location = useLocation();
  const { Data, departmentDetails } = location.state;
  //   console.log(Data);
  return (
    <div>
      <h2>User Profile</h2>
      <img
        src={Data.photo_url}
        height="250px"
        width="250px"
        alt="User"
        style={{ borderRadius: "50%", border: "2px solid #3498db" }}
      />
      <p>Roll Number: {Data.roll_number}</p>
      <p>Student Name: {Data.student_name}</p>
      <p>Email id: {Data.email_id}</p>
      <p>Address: {Data.address}</p>
      <p>Contact Number: {Data.contact_number}</p>
      <p>School of Study: {Data.school_of_study}</p>
      <p>Year of Admission: {Data.year_of_admission}</p>

      <h3>Department Details:</h3>
      {departmentDetails ? (
        departmentDetails.map((detail, index) => (
          <div key={index}>
            <p>
              Department: {detail.department_name}, Status: {detail.status}
            </p>
          </div>
        ))
      ) : (
        <p>No department details available.</p>
      )}
    </div>
  );
};

export default UserProfile;
